import React from "react";
import RankingsTabsHierarchical from "../../components/rankings/RankingsTabsHierarchical";
import '/./Rankings.css';

export default function RankingsHome() {
  return (
    <div className="icc-ranking-section">
      <div className="ranking-header">
        <h3>ICC Rankings</h3>
        <a href="/rankings" className="view-all-btn-floating">All</a>
      </div>
      <RankingsTabsHierarchical compactTop={5} />
    </div>
  );
}
